    false,nt"url": null,nt"notes": "NODC accession 0104371 includes physical
    and underway data collected aboard the THOMAS G. THOMPSON during cruise TN274 in
    the North Pacific Ocean and Philippine Sea from 2012-01-25 to 2012-02-21. These
    data include CURRENT SPEED - EAST/WEST COMPONENT (U) and CURRENT SPEED - NORTH/SOUTH
    COMPONENT (V). The instruments used to collect these data include ADCP and GPS.
    These data were collected by Douglas Wiens of Washington University in St. Louis,
    and by UNIVERSITY OF WASHINGTON as part of Mantle Serpentinization and Water Cycling
    Through the Mariana Trench and Forearc. The Lamont-Doherty Earth Observatory (LDEO)
    submitted these data to NODC as part of the NSF sponsored Rolling Deck to Repository
    (R2R) program. The ADCP data represent the raw and automated processed data set.
    Post processed quality assessed data are not available in this accession.",nt"owner_org":
